import React from 'react';
import TaskItem from './TaskItem';
import './TaskList.scss';
import { Link } from 'react-router-dom';

const TaskList = (props) => {
    const { tasks } = props;
    const taskList = !tasks.length ? (<p>no tasks</p>) : (
        tasks.map(task => {
            console.log(task);
            return (
                <div key={task._id}>
                    <link to="/" className="list-menu-item is-active" href="#">
                        <TaskItem task={task} />
                    </link>
                </div>
            )
        })
    )
    return (
        <div>{taskList}</div>
    )
}

export default TaskList
